import React from 'react';
import './home.css';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div className="home-container">

      {/* Hero Section */}
      <div className="container-home-grid-Hero">
        <div className="hero">Welcome to Learning Hub</div>
        <div className="hero">Explore React</div>
        <div className="hero">Master JavaScript</div>
        <div className="hero">Build Projects</div>
      </div>

      {/* Buttons Section */}
      <div className="container-home-grid">
        <div className="buttons">
          <Link to="/react-info">React Info</Link>
        </div>
        <div className="buttons">
          <Link to="/javascript-info">JavaScript Info</Link>
        </div>
        <div className="buttons">CSS Info</div>
        <div className="buttons">HTML Info</div>
        <div className="buttons">Node.js Info</div>
        <div className="buttons">Python Info</div>
        <div className="buttons">AI/ML Info</div>
        <div className="buttons">Projects</div>
        <div className="buttons">Resources</div>
      </div>

    </div>
  );
}

export default Home;
